import Nav from './Nav';
import styled from 'styled-components';

function Header() {
    return (
        <HeaderStyle>
            <h1>logo</h1>
            <Nav />
        </HeaderStyle>
    );
}

const HeaderStyle = styled.header`
    display: flex;
    justify-content: space-between;
`;

export default Header;
